import React, { useCallback } from 'react';
import { useHistory } from 'react-router-dom';
import { makeStyles } from '@material-ui/core/styles';
import { Link } from 'react-router-dom'
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles((theme) => ({
  appBar: {
    paddingLeft: theme.spacing(10),
    paddingRight: theme.spacing(10),
    height:100,
    justifyContent: 'center',
    background: 'transparent',
    boxShadow: 'none'
  },
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
    color:'black'
  },
  rightButton: {
    color:'black',
    marginRight: theme.spacing(2),
    marginLeft: theme.spacing(2)
  }
}));

const Nav = () => {
  const classes = useStyles();
  const history = useHistory();
  function changeRoute (route){
    useCallback(() => history.push(route), [history])
  }
  const handleOnClick = useCallback(() => history.push('/'), [history]);
  return (
    <div className={classes.root}>
      <AppBar className={classes.appBar} position="static">
        <Toolbar>
          <Typography variant="h6" className={classes.title} onClick={() => {console.log("EEE")}}>
            GreenTech
          </Typography>

          <Button className={classes.rightButton} onClick={changeRoute('/')}>Activity 1</Button>
          <Button className={classes.rightButton} onClick={handleOnClick()}>Activity 2</Button>
          <Button className={classes.rightButton} onClick={handleOnClick('/Activity3')}>Activity 3</Button>
          <Button className={classes.rightButton} onClick={handleOnClick('/Services')}>Services</Button>

        </Toolbar>
      </AppBar>
    </div>
  );
}

export default Nav
